import { useState } from "react";
import axios from "axios";
import "../styles/Profile.css";
const AddUser = () => {
    const [user, setUser] = useState({
        fullname: "",
        email: "",
        phone_no: "",
        gender: "",
        dob: "",
        religion: "",
        caste: "",
        age: "",
        occupation: "",
        height: "",
        horoscope_details: "",
        fatherName: "",
        fatherOccupation: "",
        motherName: "",
        motherOccupation: "",
        brothers: 0,
        sisters: 0,
        familyStatus: "",
        familyType: "",
        familyValues: "",
        nativePlace: "",
    });

    const handleChange = (e) => {
        setUser({ ...user, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const token = localStorage.getItem("token"); // Get admin token
            const response = await axios.post("http://localhost:5000/api/admin/add-user", user, {
                headers: { Authorization: `Bearer ${token}` }
            });
            setUser(response.data);
            alert("User added successfully!");
        } catch (error) {
            console.error(error);
            alert("Error adding user!");
        }
    };

    return (
        <div>
            <h2>Add User</h2>
            <form onSubmit={handleSubmit}>
                <input type="text" name="fullname" placeholder="Full Name" onChange={handleChange} required />
                <input type="email" name="email" placeholder="Email" onChange={handleChange} required />
                <input type="text" name="phone_no" placeholder="Phone No" onChange={handleChange} required />
                <input type="text" name="gender" placeholder="Gender" onChange={handleChange} required />
                <input type="date" name="dob" onChange={handleChange} required />
                <input type="text" name="religion" placeholder="Religion" onChange={handleChange} required />
                <input type="text" name="caste" placeholder="Caste" onChange={handleChange} />
                <input type="number" name="age" placeholder="Age" onChange={handleChange} required />
                <input type="text" name="occupation" placeholder="Occupation" onChange={handleChange} />
                <input type="text" name="height" placeholder="Height" onChange={handleChange} />
                <input type="text" name="horoscope_details" placeholder="Horoscope Details" onChange={handleChange} />

                <h3>Family Details</h3>
                <input type="text" name="fatherName" placeholder="Father's Name" onChange={handleChange} />
                <input type="text" name="fatherOccupation" placeholder="Father's Occupation" onChange={handleChange} />
                <input type="text" name="motherName" placeholder="Mother's Name" onChange={handleChange} />
                <input type="text" name="motherOccupation" placeholder="Mother's Occupation" onChange={handleChange} />
                <input type="number" name="brothers" placeholder="Brothers" onChange={handleChange} />
                <input type="number" name="sisters" placeholder="Sisters" onChange={handleChange} />
                <input type="text" name="familyStatus" placeholder="Family Status" onChange={handleChange} />
                <input type="text" name="familyType" placeholder="Family Type" onChange={handleChange} />
                <input type="text" name="familyValues" placeholder="Family Values" onChange={handleChange} />
                <input type="text" name="nativePlace" placeholder="Native Place" onChange={handleChange} />

                <button type="submit">Add User</button>
            </form>
        </div>
    );
};

export default AddUser;
